svg.script:
  document.addEventListener("DOMContentLoaded", function() {
    const svgNS = "http://www.w3.org/2000/svg";
    const element = document.querySelector('svg');
    const player = element ? element.svgatorPlayer : null;

    // Define play and pause paths
    const playPath = "M-2,-4 L6,0 L-2,4 Z";
    const pausePath = "M-3,-3 H-4 V3 H-3 V-3 M0,-3 H1 V3 H0 V-3";

    function createIconPath(d, transform) {
      const path = document.createElementNS(svgNS, "path");
      path.setAttribute("d", d);
      path.setAttribute("fill", "#06f");
      if (transform) {
        path.setAttribute("transform", transform);
      }
      return path;
    }

    if (player) {
      player.ready(function() {
        if (player.duration > 4999) {
          const svgWidth = element.viewBox.baseVal.width || element.width.baseVal.value;
          const svgHeight = element.viewBox.baseVal.height || element.height.baseVal.value;
          const buttonGroup = document.createElementNS(svgNS, "g");
          buttonGroup.setAttribute("transform", `translate(${svgWidth - 20}, ${svgHeight - 20})`);

          const circle = document.createElementNS(svgNS, "circle");
          circle.setAttribute("cx", "0");
          circle.setAttribute("cy", "0");
          circle.setAttribute("r", "15");
          circle.setAttribute("fill", "#FFF");
          circle.setAttribute("stroke", "#06f");
          circle.setAttribute("stroke-width", "1.5");
          buttonGroup.appendChild(circle);

          const iconTransform = "scale(1.8)";

          const icon = createIconPath(pausePath, `translate(1.8, 0) ${iconTransform}`);
          buttonGroup.appendChild(icon);

          buttonGroup.addEventListener("click", () => player.toggle());

          player.on("play, restart", () => {
            icon.setAttribute("d", pausePath);
            icon.setAttribute("transform", `translate(1.8, 0) ${iconTransform}`);
          });
          player.on("pause", () => {
            icon.setAttribute("d", playPath)
            icon.setAttribute("transform", `translate(-2.4, 0) ${iconTransform}`)
          });

          element.appendChild(buttonGroup);
        }
      });
    }
  });
